import React from 'react';

export class InfoPage extends React.Component{
    render() {
        return(
            <div className="container-fluid" style={{padding: 20, backgroundColor: '#28B463'}}>
                <div className="container">
                <h6 style={{float: 'left', paddingLeft:3}}>
                    <i class="fa fa-phone" aria-hidden="true"></i>
                    01778235029
                    |
                    <i class="far fa-envelope"></i>
                    mahedi_cse@hotmail.com
                </h6>
                <h6 style={{float: 'right', paddingLeft:3}}>
                <i class="fab fa-facebook-f"></i>
                <i class="fab fa-twitter"></i>
                <i class="fab fa-linkedin-in"></i>
                <i class="fab fa-youtube"></i>
                |
                <i class="fas fa-shopping-bag"></i>
                </h6>
                </div>
            </div>
        );
    }
}
